import React from "react";
import "../../App.css";
export default function ProjectNavItem(props) {
  return (
    <li className="project-nav-item" onClick={props.onClick}>
      <div>
        <input
          type="text"
          className="type-project"
          placeholder="Enter project name"
          ref={(input) => input && input.focus()}
          onKeyPress={(e) => props.handleProjectTitle(e)}
        />
        <span className="set-project"></span>
        {props.index !== 0 ? (
          <button
            className="project-delete"
            onClick={(e) => props.handleProjectDeletion(e)}
          >
            <i className="fa-solid fa-trash"></i>
          </button>
        ) : (
          <button>Hi</button>
        )}
      </div>
    </li>
  );
}
